import React from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";

export default function CoffeeShop({ totalItems }) {
  const navigate = useNavigate();

  const buttonStyle = {
    border: "none",
    width: "140px",
    height: "260px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
    backgroundColor: "#F3E9DC",
    borderRadius: "16px",
    boxShadow: "0 6px 15px rgba(161, 117, 87, 0.3)",
    textAlign: "center",
    transition: "transform 0.3s ease, box-shadow 0.3s ease",
  };

  const buttonHoverStyle = {
    transform: "translateY(-8px) scale(1.05)",
    boxShadow: "0 12px 25px rgba(161, 117, 87, 0.5)",
  };

  const imgStyle = {
    width: "120px",
    height: "120px",
    borderRadius: "16px",
    objectFit: "cover",
    boxShadow: "0 4px 10px rgba(106, 153, 78, 0.3)",
  };

  const labelStyle = {
    fontFamily: "'Georgia', serif",
    marginTop: "12px",
    backgroundColor: "#A17557",
    borderRadius: "8px",
    padding: "8px 12px",
    width: "fit-content",
    color: "#F7EFE2",
    fontWeight: "bold",
    fontSize: "1.1rem",
    boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
    userSelect: "none",
  };

  const [hovered, setHovered] = React.useState(null);

  // Back button style with subtle shadow and hover effect
  const backButtonStyle = {
    fontSize: "1.5rem",
    cursor: "pointer",
    backgroundColor: "#A17557",
    border: "none",
    borderRadius: "50%",
    width: "60px",
    height: "60px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    position: "absolute",
    bottom: "17px",
    right: "100px",
    color: "#F7EFE2",
    boxShadow: "0 4px 12px rgba(161,117,87,0.7)",
    transition: "background-color 0.3s ease",
  };

  const backButtonHoverStyle = {
    backgroundColor: "#6A994E",
  };

  return (
    <div
      style={{
        textAlign: "center",
        padding: "2rem 1rem",
        backgroundColor: "#F7EFE2",
        minHeight: "100vh",
        fontFamily: "'Georgia', serif",
        color: "#4B2E05",
      }}
    >
      {/* Container for back button + cart icon */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
          gap: "10px",
          width: "100%",
          maxWidth: "800px",
          margin: "0 auto 1.5rem auto",
          padding: "0 1rem",
          position: "relative",
        }}
      >
        {/* Back Home Button */}
        <button
          onClick={() => navigate("/")}
          style={{
            ...backButtonStyle,
            ...(hovered === "back" ? backButtonHoverStyle : {}),
          }}
          aria-label="Back to Home"
          title="Back to Home"
          onMouseEnter={() => setHovered("back")}
          onMouseLeave={() => setHovered(null)}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="28"
            height="28"
            fill="none"
            stroke="currentColor"
            strokeWidth="2.5"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart Icon */}
        <CartIcon totalItems={totalItems} />
      </div>

      <h1
        style={{
          fontWeight: "bold",
          fontSize: "2.2rem",
          marginBottom: "2rem",
          textShadow: "1px 1px 3px rgba(161,117,87,0.7)",
          userSelect: "none",
        }}
      >
        ☕ Welcome to Your Coffee Shop
      </h1>

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(140px, 1fr))",
          gap: "2rem",
          maxWidth: "800px",
          margin: "auto",
          paddingBottom: "3rem",
        }}
      >
        {[{
          key: "espresso",
          img: espressoImg,
          label: "Espresso",
          nav: "/espresso"
        },{
          key: "refresher",
          img: refresherImg,
          label: "Refresher",
          nav: "/refresher"
        },{
          key: "tea",
          img: teaImg,
          label: "Tea",
          nav: "/tea"
        },{
          key: "blended",
          img: blendedImg,
          label: "Blended Beverage",
          nav: "/blended"
        },{
          key: "pastry",
          img: pastryImg,
          label: "Pastry",
          nav: "/pastry"
        }].map(({ key, img, label, nav }) => (
          <button
            key={key}
            onClick={() => navigate(nav)}
            style={{
              ...buttonStyle,
              ...(hovered === key ? buttonHoverStyle : {}),
            }}
            onMouseEnter={() => setHovered(key)}
            onMouseLeave={() => setHovered(null)}
            aria-label={label}
          >
            <img src={img} alt={label} style={imgStyle} />
            <div style={labelStyle}>{label}</div>
          </button>
        ))}
      </div>
    </div>
  );
}
